import React from "react";
import '../css/MobileDevice.css'
import { Stack, Typography, Item } from "@mui/material";

var MobileDevice = () => {
    return ( 
        <div className="mobile-device">
            <Stack spacing={10}>
                <h1>Hello World</h1>
            </Stack>
        </div>
    )
}

export default MobileDevice;
